import Draggable from 'react-draggable';

function FileWindow () {
    return (
        <Draggable 
            axis="x"
            handle=".handle"
            defaultPosition={{x: 0, y: 0}}
            position={null}
            grid={[25, 25]}
            scale={1}
            onStart={this.handleStart}
            onDrag={this.handleDrag}
            onStop={this.handleStop}
            class="bg-white w-10 h-10">
            <div>
                Hello
            </div>
        </Draggable>
    )
}

export default FileWindow;
